import React from 'react';
import Modal from './Modal';

function Home() {

    const homeBannerImg = {
        backgroundImage: 'url("/images/homeDark.png")',
    }

    const bannerTxt = {
        color: '#fff',
        margin: '0',
        paddingTop: '10vh',
        fontFamily: 'arial, san-serif',
        fontSize: '4.5vw',
        fontWeight: '300',
    }

  return (
    <>    
        <div className="content">
            <div className="banner" style={ homeBannerImg }>
                <h2 style={ bannerTxt }>
                    Restoration, Repair &amp; Waterproofing
                </h2>
            </div>
            <Modal />
        </div>
    </>
  );
}

export default Home;
